#How its asked in problem( Simple version)
def count_nucleotides(data):
    a = data.count('A')
    t = data.count('C')
    g = data.count('G')
    c = data.count('T')
    return print(f'{a} {t} {g} {c}')

if __name__ == '__main__':
    print(count_nucleotides(data))

